import React from 'react';

const ModelsList = () => {
  return (
    <div>
      <h1 className="text-2xl font-semibold text-gray-900 mb-6">3D Models</h1>
      <p className="text-gray-600">List of 3D models will be displayed here.</p>
    </div>
  );
};

export default ModelsList;
